  const [Email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  return (  
      <div>
      <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="computer/100px180"/>
      <Card.Body>
      <Card.Title>Computer</Card.Title>
      <Card.Text>
      Click here to see more Computers.
      </Card.Text>
      <Button variant="primary"onClick={(e) => {
      e.preventDefault();
      window.location.href='/Constraction';
      }}>Buy</Button>
      </Card.Body>
      </Card>
      </div>
  );
}
export default Category;
